import React, { useState, useEffect } from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

function TotalStoryPointBarChart() {
  const [chartData, setChartData] = useState(null);

  useEffect(() => {
    // Fetch data from the API
    fetch('http://localhost:4000/api/available-sp')
      .then(response => response.json())
      .then(data => {
        // Set the fetched data to the state
        setChartData(data);

        // Log chartData after it's been set
        console.log(data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  console.log(chartData)

  return (
    <div>
      {chartData ? (
        <BarChart
          xAxis={[{ scaleType: 'band', data: chartData.xAxisData }]}
          series={[{ data: chartData.seriesData }]}
          width={500}
          height={300}
        />
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default TotalStoryPointBarChart;
